import React, { useState, useEffect } from 'react';

const labTests = [
    { name: "Blood Test", price: "₹740", guidelines: "Avoid eating or drinking anything except water for at least 8 hours before the test." },
    { name: "Urine Test", price: "₹660", guidelines: "Make sure the urine sample is collected in a clean container. Avoid consuming caffeine or alcohol before the test." },
    { name: "X-Ray", price: "₹1,500", guidelines: "Wear loose, comfortable clothing and remove any metal objects such as jewelry, belts, or glasses." },
    { name: "MRI Scan", price: "₹5,000", guidelines: "Avoid wearing metal items. Inform the technician if you have any implants or medical devices." },
    { name: "CT Scan", price: "₹4,500", guidelines: "You may be required to fast for a few hours before the test. Inform the technician if you are pregnant or breastfeeding." },
    { name: "ECG (Electrocardiogram)", price: "₹1,000", guidelines: "Avoid oily skin lotions or creams. Wear loose-fitting clothes to expose your chest area." },
    { name: "Echocardiogram", price: "₹3,000", guidelines: "Do not eat a heavy meal at least 2 hours before the test. Wear loose clothing to allow easy access to your chest area." },
    { name: "Lung Function Test", price: "₹2,500", guidelines: "Avoid strenuous activity and heavy meals before the test. You may be asked to withhold medications for a certain period." },
    { name: "Liver Function Test", price: "₹1,500", guidelines: "Do not drink alcohol for 24 hours before the test. You may be asked to fast for 8–12 hours prior to the test." },
    { name: "Kidney Function Test", price: "₹2,200", guidelines: "Stay hydrated before the test. Avoid heavy exercise and consult with your doctor regarding any medications you are on." },
    { name: "Thyroid Function Test", price: "₹1,800", guidelines: "Avoid taking any thyroid medications before the test. Fasting for 8–12 hours may be required." },
    { name: "Pregnancy Test", price: "₹500", guidelines: "For the urine test, collect the first morning urine sample. For blood tests, consult your doctor." },
    { name: "Vitamin D Test", price: "₹1,200", guidelines: "There are no specific preparations required. However, avoid taking supplements right before the test." },
    { name: "Diabetes Test (Blood Sugar Test)", price: "₹650", guidelines: "Fast for at least 8 hours before the test, and avoid drinking sugary beverages." },
  ];
  

const LabTests = () => {
  const [selectedTest, setSelectedTest] = useState(null);
  const [isPaymentSuccess, setIsPaymentSuccess] = useState(false);

  // Load Razorpay Script Dynamically
  useEffect(() => {
    const script = document.createElement("script");
    script.src = "https://checkout.razorpay.com/v1/checkout.js";
    script.async = true;
    document.body.appendChild(script);

    return () => {
      document.body.removeChild(script); // Clean up the script on component unmount
    };
  }, []);

  const handleSelectTest = (test) => {
    setSelectedTest(test);
    setIsPaymentSuccess(false); // Reset payment success status on test selection
  };

  const handlePaymentSuccess = () => {
    setIsPaymentSuccess(true);
  };

  const initiatePayment = (test) => {
    if (window.Razorpay) {
      const options = {
        key: "rzp_test_lmkOFuIPmT2vi9", // Replace with your Razorpay key
        amount: parseFloat(test.price.replace("₹", "")) * 100, // Convert to paise (Razorpay accepts amount in paise)
        currency: "INR",
        name: "Health App",
        description: "Lab Test Payment",
        handler: function (response) {
          if (response.razorpay_payment_id) {
            // On successful payment, show the guidelines
            handlePaymentSuccess();
          }
        },
        prefill: {
          name: "Test User",
          email: "testuser@example.com",
          contact: "+911234567890",
        },
        notes: {
          address: "Health App Office",
        },
      };

      const razorpayInstance = new window.Razorpay(options);
      razorpayInstance.open();
    } else {
      console.error("Razorpay SDK failed to load.");
    }
  };

  return (
    <div className="p-6 bg-light-gray rounded-lg shadow-2xl">
      <h2 className="text-3xl font-semibold text-soft-blue mb-4">Available Lab Tests</h2>
      <ul className="space-y-4">
        {labTests.map((test, index) => (
          <li key={index} className="border-b pb-4">
            <div className="flex justify-between items-center">
              <div>
                <h3 className="text-xl font-bold text-gray-800">{test.name}</h3>
                <p className="text-gray-600">Price: {test.price}</p>
              </div>
              <button
                className="bg-soft-blue text-white px-4 py-2 rounded-lg shadow-2xl transition duration-300 ease-in-out hover:scale-105 animate-button-pulse"
                onClick={() => handleSelectTest(test)}
              >
                View Guidelines
              </button>
            </div>
            {selectedTest === test && !isPaymentSuccess && (
              <div className="mt-2 p-4 border-t border-gray-300">
                <h4 className="text-lg font-semibold text-gray-700">Please make a payment to view guidelines:</h4>
                <button
                  className="mt-2 bg-green-500 text-white px-4 py-2 rounded-lg shadow-2xl"
                  onClick={() => initiatePayment(test)}
                >
                  Pay Now
                </button>
              </div>
            )}
            {selectedTest === test && isPaymentSuccess && (
              <div className="mt-2 p-4 border-t border-gray-300">
                <h4 className="text-lg font-semibold text-gray-700">Guidelines:</h4>
                <p className="text-gray-600">{test.guidelines}</p>
              </div>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default LabTests;
